import React from 'react';
import { Swiper, SwiperSlide } from 'swiper/react';
import 'swiper/css';
import 'swiper/css/navigation';
import '../../styles.css';
import { Grid } from 'swiper/modules';
import { Pagination } from 'swiper/modules';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faStore, faTruck } from '@fortawesome/free-solid-svg-icons';

function CadastroFornecedor() {
const icons = [
{id: '1', icon: faStore},
{id: '2', icon: faTruck}
]
return (
    // Backgroud do sistema
<div className="bg-gradient-to-r from-black to-green-500 w-screen h-screen">
    {/* Slider */}
    <div className='bg-emerald-900'>
        <Swiper slidesPerView={4} grid={{
          rows: 1,
        }} spaceBetween={30} pagination={{
          clickable: true,
        }} modules={[Grid, Pagination]} className="mySwiper h-28">
            {/* Slide 1 */}
            <SwiperSlide className='bg-emerald-600'>
                <div className='flex flex-col gap-0.5'>
                    {icons.map((item) => (
                    <FontAwesomeIcon icon={item.icon} className='h-20' key={item.id}/>
                    ))}
                    <label className='text-white font-bold'>
                        Cadastro de Fornecedores
                    </label>
                </div>
            </SwiperSlide>
            {/* Slide 2 */}
            <SwiperSlide>
                <div className='flex flex-col gap-0.5'>
                    {icons.map((item) => (
                    <FontAwesomeIcon icon={item.icon} className='h-20' />
                    ))}
                    <label className='text-white font-bold'>
                        Cadastro de Vendedores
                    </label>
                </div> 
            </SwiperSlide>
            <SwiperSlide>Slide 3</SwiperSlide>
            <SwiperSlide>Slide 4</SwiperSlide>
            <SwiperSlide>Slide 5</SwiperSlide>
            <SwiperSlide>Slide 6</SwiperSlide>
            <SwiperSlide>Slide 7</SwiperSlide>
            <SwiperSlide>Slide 8</SwiperSlide>
            <SwiperSlide>Slide 9</SwiperSlide>
        </Swiper>
    </div>
</div>
);
}


export default CadastroFornecedor;
